    <p style="position:absolute; left:148px; top:116px; width:576px; height:836px;font-size:16px;font-weight:400;color:rgba(48,48,48,1);">The following documentation is provided as a guide for developers. There are no grid styles/settings within Figma as we rely solely on auto layout for grid definitions. <br/><br/>These rules are all represented in Storybook.<br/><br/>––<br/><br/>Simple Design System relies on Flex for the layout system. <br/><br/>There are two components:<br/><br/>Flex<br/>FlexItem<br/><br/>Flex can be a container, which snaps its widths responsively.<br/><br/>By default, any child of Flex is an item, but explicit child layouts are created using FlexItems.<br/><br/>Flex components can be aligned to a grid that we define as:<br/><br/>Auto<br/>Quarter<br/>Third<br/>Half grids<br/><br/>FlexItems can be set to:<br/><br/>Minor<br/>Major<br/>Half<br/>Full<br/><br/>These change at breakpoints, becoming full width on mobile.<br/><br/>Flex components must explicitly set to wrap.</p>
