    <p style="position:absolute; left:2685px; top:6276px; width:212px; height:110px;font-size:16px;font-weight:400;color:rgba(48,48,48,1);">We recommends using inline style overrides e.g. bold (strong), italic (emphasis), or underlines for body content.</p>
    <p style="position:absolute; left:2685px; top:6414px; width:212px; height:132px;font-size:16px;font-weight:600;color:rgba(48,48,48,1);">For longer, more consistently styled, text strings, implementing variables within a text style will align a lot closer to code.</p>
    <p style="position:absolute; left:2985px; top:6232px; width:142px; height:16px;font-size:16px;font-weight:400;color:rgba(144,11,9,1);">Not recommended</p>
    <p style="position:absolute; left:2985px; top:6276px; width:212px; height:66px;font-size:16px;font-weight:600;color:rgba(48,48,48,1);">Figma doesn’t recommend using inline style overrides for large blocks of text.</p>
    <p style="position:absolute; left:2985px; top:6366px; width:212px; height:110px;font-size:16px;font-weight:400;color:rgba(48,48,48,1);">Instead, create a reusable text style that can be applied in many place and enforcing a consistent design system.</p>
    <p style="position:absolute; left:2985px; top:6500px; width:212px; height:44px;font-size:16px;font-weight:400;color:rgba(48,48,48,1);">Your developer partners will thank you too.</p>
